 *              filesystem.
 * @return      the filename
 */
private String filenameFromURL( URL url ) 
{
    String filename = url.getFile();
    if ( filename != null )
    {
        if ( filename.startsWith( "/" ) )
        {
            filename = filename.substring( 1 );
        }
    }
    return filename;
}

