    case OP_AGET_BOOLEAN:
    case OP_AGET_BYTE:
    case OP_AGET_CHAR:
    case OP_AGET_OBJECT:
    case OP_AGET_SHORT:
    case OP_AGET_WIDE:
        info(opcode, "v%d=v%d[v%d]", value, array, index);
        break;
    }
    super.visitArrayInsn(opcode, value, array, index);
