 */
protected String removeTrackNumberFromTitle(String title, Integer trackNumber) 
{
    if (trackNumber == null)
    {
        return title;
    }

    String prefix = trackNumber + " - ";
    if (title.startsWith(prefix))
    {
        return title.substring(prefix.length());
    }
    else
    {
        return title;
    }
}

