/**
 * Escape the given String and place within double quotes so that it
 * will be a valid ActionScript string literal.
 */
public static String str(String str) 
{
    StringBuilder buf = new StringBuilder();
    buf.append('"');

    for (int i = 0; i < str.length(); i++)
    {
        char c = str.charAt(i);

        switch (c)
        {
            case '"':
                buf.append("\\\"");
                break;
            case '\\':
                buf.append("\\\\");
                break;
            case '\b':
                buf.append("\\b");
                break;
            case '\f':
                buf.append("\\f");
                break;
            case '\n':
                buf.append("\\n");
                break;
            case '\r':
                buf.append("\\r");
                break;
            case '\t':
                buf.append("\\t");
                break;
            default:
                buf.append(c);
        }
    }

    buf.append('"');

    return buf.toString();
}

