 * @return
 */
private boolean waitForPageLoadAndDojoReady(String elementId){
    selenium.waitForPageToLoad(PAGE_LOAD_TIMEOUT);
    try {
        Thread.sleep(PAGE_READY_TIMEOUT);
        if (isDojoLoaded(false)) {
