 *            true
 */
public void waitForTextToChange(String message, String newValue,
        String element, int seconds) 
{
    int i = 0;
    while (i++ < seconds)
    {
        String text = getText(element);
        if (!text.equals(newValue))
            return;
        try
        {
            Thread.sleep(DEFAULT_WAIT_PERIOD);
        }
        catch (InterruptedException e)
        {
            e.printStackTrace();
        }
    }
    fail(message);
}

