//-------------------------------------------------------------------------------------- moveFrom
public boolean moveFrom(RealInventory source, int typeId, int amount, short durability) 
{
    if (amount <= 0)
        return false;

    if (amount > _itemCount)
        return false;

    if (typeId != _typeId)
        return false;

    if (durability != _durability)
        return false;

    if (!source.decreaseItemCount(_item, amount))
        return false;

    increaseItemCount(_item, amount);
    return true;
}

