/** Handle {@link SessionsQuery} {@link Cursor}. */
private void onSessionQueryComplete(Cursor cursor) 
{
    if (cursor != null)
    {
        try
        {
            if (cursor.moveToFirst())
            {
                do
                {
                    Session session = Session.fromCursor(cursor);
                    if (session != null)
                    {
                        sessions.add(session);
                    }
                }
                while (cursor.moveToNext());
            }
        }
        finally
        {
            cursor.close();
        }
    }
}

