protected void addDeviceParameter(List<String> commands){
    if (StringUtils.isNotBlank(device)) {
        if ("usb".equals(device)) {
            commands.add("-d");
        } else if ("emulator".equals(device)) {
            commands.add("-e");
        } else {
            commands.add("-s");
            commands.add(device);
        }
    }
}

