public Layer createInputLayer(int layerId, int nNodes){

    BaseLayer baseLayer = new BaseLayer(layerId);
    for(int i = 0; i < nNodes; i++) {
        Node node = createInputNode(layerId + ":" + i);
        Link inlink = new BaseLink();
        inlink.setFromNode(node);
