                  stat[i].isDir(),
                  stat[i].getReplication(),
                  stat[i].getBlockSize(),
                  stat[i].getModificationTime(),
                  stat[i].getPermission().toString(),
                  stat[i].getOwner(),
                  stat[i].getGroup());
      value.add(tmp);
    }
    return value;
  } catch (IOException e) {
    throw new ThriftIOException(e.getMessage());
