/** 
 * Generates a random sequence number
 */
private void generateSeqNum(){
	if(this.random == null)
		createRandom();

	seqNum = this.random.nextInt();
	if(seqNum < 0)
		seqNum = -seqNum;
	while(seqNum > 65535) {
		seqNum = seqNum / 10;
	}
}

