    // update view settings
    final int view = getJNIView();
    if (view == 0)
    {
        newSettings.put("view", "0");
    }
    else if (view == 1)
    {
        newSettings.put("view", "1");
    }
    else if (view == 2)
    {
        newSettings.put("view", "2");
    }

    if (save)
    {
        saveProperties(newSettings);
    }
}

