// for dx=0..1 find such alpha (0..pi/2) that alpha - sin(alpha) = dx  
private static double shiftfn( double dx ){
	double a = 0;
	double b = Math.PI/2;
	double c = 0;
	for ( int i=0; i<15; i++ ) {
		c = (a + b) / 2;
		double cq = c - Math.sin(c);
		if ( cq < dx )
			a = c;
		else
			b = c;
	}
	return c;
}

