// for dx=0..1 find such alpha (0..pi/2) that alpha - sin(alpha) = dx  
private static double shiftfn( double dx ) 
{
    double alpha = dx;
    for( int i = 0; i < 30; i++ )
    {
        alpha = alpha - (alpha - Math.sin( alpha )) / 2;
    }
    return alpha;
}

