/**
 * Gets an array containing the frequencies in natural order. Data are
 * separated by delta.
 * 
 * @param delta
 * @return the array of frequencies
 */
public double[] getNaturalFreq(final double delta){
	int n = this.n / 2;
	double[] freq = new double[n];
	double f = 0, df = 0.5 / n / delta;
	for (int i = 0; i < n; i++) {
		freq[i] = f;
		f += df;
	}
	return freq;
}

