/**
 * Gets the derivative of this polynomial.
 * 
 * @return Polynomial the derivative.
 */
public Polynomial derivative(){
	int n = degree();
	if (n == 0) {
		double coef[] = { 0 };
		return new Polynomial(coef);
	}
	double coef[] = new double[n];
	for (int i = 1; i <= n; i++) {
		coef[i - 1] = coefficients[i] * i;
	}
	return new Polynomial(coef);
}

