/**
 * Evaluates a polynomial using the given coefficients.
 * 
 * @param x
 * @param coeff
 *            the polynomial coefficients.
 */
public static double evalPolynomial(final double x, final double[] coeff) 
{
    double y = coeff[0];
    for (int i = 1; i < coeff.length; i++)
    {
        y = y * x + coeff[i];
    }
    return y;
}

