/*
 * (non-Javadoc)
 * @see java.nio.charset.CharsetDecoder#decodeLoop(java.nio.ByteBuffer,
 * java.nio.CharBuffer)
 */
protected CoderResult decodeLoop(ByteBuffer in, CharBuffer out){
    while (in.hasRemaining()) {
        byte b = in.get();
        if (base64mode) {
            if (b == unshift) {
                if (base64bitsWaiting())
                    return malformed(in);
                if (justShifted) {
                    if (!out.hasRemaining())
                        return overflow(in);
                    out.put((char)shift);
                } else
                    justUnshifted = true;
                setUnshifted();
            } else {
                if (!out.hasRemaining())
                    return overflow(in);
                CoderResult result = handleBase64(in, out, b);
                if (result != null)
                    return result;
            }
            justShifted = false;
        } else {
            if (b == shift) {
                base64mode = true;
                if (justUnshifted && strict)
                    return malformed(in);
                justShifted = true;
                continue;
            }
            if (!out.hasRemaining())
                return overflow(in);
            out.put((char)b);
            justUnshifted = false;
        }
    }
    return CoderResult.UNDERFLOW;
}

