public final void postToUi(final Type type, final Bundle bundle,
        final boolean update) 
{
    if (Looper.myLooper() == Looper.getMainLooper()) {
        handleUiMessage(type, bundle, update);
    } else {
        mUiHandler.post(new Runnable() {
            @Override
            public void run() {
                handleUiMessage(type, bundle, update);
            }
        });
    }
}

