/**
 * Set the bit in the specified position in the binary map to a specified
 * value
 * 
 * @param row
 *            the row
 * @param col
 *            the column
 * @param value
 *            the value
 */
public void set(int row, int col, boolean value) 
{
    if (value)
    {
        map[row] |= (1 << col);
    }
    else
    {
        map[row] &= ~(1 << col);
    }
}

