 * @throws IOException
 */
public void write(LISAImageGray16Bit image) throws IOException 
{
    if (image == null)
    {
        throw new IllegalArgumentException("image must be non-null");
    }
    if (image.getDepth() != 16)
    {
        throw new IllegalArgumentException("image depth must be 16");
    }

    writeHeader(image);
    writeData(image);
}

