/**
 * Create commit file from diff entry
 * 
 * @param entry
 */
public CommitFile(DiffEntry entry){
	type = entry.getChangeType();
	switch (type) {
	case ADD:
		oldPath = null;
		newPath = entry.getNewPath();
		break;
	case DELETE:
		oldPath = entry.getOldPath();
		newPath = null;
		break;
	case COPY:
	case MODIFY:
	case RENAME:
	default:
		oldPath = entry.getOldPath();
		newPath = entry.getNewPath();
		break;
	}
}

