// Assign to cluster:
// * Associated with highest load value
protected byte allocateClusterBasic(ArrayList<Double> wC,
		ArrayList<Double> lC){
	byte maxC = 0;
	double maxW = 0.0;

	for (byte c = 0; c < wC.size(); c++) {

		double loadTotal = wC.get(c);

		if (loadTotal > maxW) {
			maxW = loadTotal;
			maxC = c;
		}
	}

	return maxC;
}

