/**
 * Updates the time in the model
 * @param time New cycle time
 */
@Override
public void setTime(long time){
	super.setTime(time);
	if (time == 0)
	{
		turn = TurnType.firstTurn;
		return;
	}

	TurnType[] t = TurnType.values();

	int next = turn.ordinal() + 1;
	if (next == t.length)
	{
		next = 0;
		rounds++;
	}

	turn = t[next];
}

