/**
 * Random sorting utility function
 * @param values The array to randomising
 */
private static void sort(String[] values){
	int i;
	String temp;
	for (i = 0; i < values.length; i++)
	{
		int r = (rand.nextInt() & 0x7FFFFFFF) % values.length;
		temp = values[i];
		values[i] = values[r];
		values[r] = temp;
	}
}

