        "A B C E",
        "A B D E",
        "B C D E",
        "A C D E"
    };

    final String[] expected =
    {
        "A B C D E"
    };

    final String[][] result = Apriori.apriori(input, 0.5);
    assertArrayEquals(expected, result[1]);
}

