public static MoveRobber parseDataStr(String s) 
{
    String[] parts = s.split(" ");
    if (parts.length == 2)
    {
        try
        {
            int player = Integer.parseInt(parts[0]);
            int tile = Integer.parseInt(parts[1]);
            return new MoveRobber(player, tile);
        }
        catch (NumberFormatException e)
        {
            return null;
        }
    }
    return null;
}

