// runs iterations of the E-M algorithm to learn the model
public double run(int iters){
	double ll = -1;

	for (int iter=0; iter < iters; ++iter) {
		// -- E-step ---
		zero(wk); ll = 0;
		for (int i=0; i < k; ++i) {
			double max = Double.MIN_VALUE;
			for (int j=0; j < N; ++j) {
				w[i][j] = gaussian(X[j], u[i], s[i]) * p[i];
				wk[j] += w[i][j];
				if (w[i][j] > max) max = w[i][j];
			}
			ll += Math.log(max);
		}
		for (int j=0; j < N; ++j) {
			for (int i=0; i < k; ++i) {
				w[i][j] /= wk[j];
			}
		}

		// -- M-step ---

		// compute new means and class probabilities
		zero(ws); zero(u); zero(s); zero(p);
		for (int i=0; i < k; ++i) {
			for (int j=0; j < N; ++j) {
				u[i] += w[i][j] * X[j];
				ws[i] += w[i][j];
			}
		}
		for (int i=0; i < k; ++i) {
			u[i] /= ws[i];
			p[i] = ws[i] / N;
		}

		// compute new variance
		for (int i=0; i < k; ++i) {
			for (int j=0; j < N; ++j) {
				s[i] += w[i][j] * (X[j] - u[i]) * (X[j] - u[i]);
			}
		}
		for (int i=0; i < k; ++i) {
			s[i] = s[i] / ws[i];
		}
	}
	update(); // recalculate measures and densities
	return loglik;
}

