/**
 * Convex hull helper method for detecting a non left turn about 3 points
 */
private static boolean isNonLeft(int i0, int i1, int i2, int i3, double[] pts) 
{
    double x0 = pts[i0];
    double y0 = pts[i0+1];
    double x1 = pts[i1];
    double y1 = pts[i1+1];
    double x2 = pts[i2];
    double y2 = pts[i2+1];
    double x3 = pts[i3];
    double y3 = pts[i3+1];
    double dx0 = x1 - x0;
    double dy0 = y1 - y0;
    double dx1 = x3 - x2;
    double dy1 = y3 - y2;
    double zcrossproduct = dx0 * dy1 - dy0 * dx1;
    return zcrossproduct < 0;
}

