/**
 * Resets the virtual machine.
 */
public void resetMachine() 
{
    // Reset the registers
    for (int i = 0; i < registers.length; i++)
    {
        registers[i] = 0;
    }

    // Reset the memory
    for (int i = 0; i < memory.length; i++)
    {
        memory[i] = 0;
    }

    // Reset the program counter
    programCounter = 0;
}

