 *             exists but is not a directory.
 */


public static void mkdirIfNecessary(File file) throws FileNotFoundException 
{
    if (!file.exists())
    {
        if (!file.mkdirs())
        {
            throw new FileNotFoundException("Unable to create directory: " + file.getAbsolutePath());
