	int decayInterval = Math.round(respawnInterval * 0.8f);
	if(decayInterval > 240)
		decayInterval = 240;

	return ThreadPoolManager.getInstance().schedule(new Runnable()
	{
		@Override
		public void run()
		{
			npc.getController().onDespawn(false);
		}
	}, decayInterval * 1000);
}

